import React from "react";
import { Link } from "react-router-dom";
import "./footer.css"

const Footer = (props) => {
    return (
      <div className="footer">
        <div className="footer-content panel">
          <div className="footer-links panel-inset ">
            <a href="contacts">Contact</a>
            <span className="separator">|</span>
            <a href="https://www.linkedin.com/in/joao-duarteee">LinkedIn</a>
            <span className="separator">|</span>
            <a href="">Filler</a>
            <span className="separator">|</span>
            <a href="">Sample</a>
          </div>
          <div className="footer-middle panel-inset"></div>
          <div className="footer-copyright panel-inset">Copyright © 2022 - 2023 João Duarte Software - all rights reserved.</div>
        </div>
      </div>
    );
  };

export default Footer;
